import { SubgraphQueryHandler, } from "../../subgraphQueryHandler";
import { TokensDocument, } from "./tokens.generated";
export class TokenQueryHandler extends SubgraphQueryHandler {
    constructor() {
        super(...arguments);
        this.getAddressFieldKeysFromFilter = () => ({
            accountKeys: [],
            tokenKeys: ["id", "underlyingToken", "underlyingAddress"],
        });
        this.getRelevantAddressesFromResultCore = (result) => ({
            tokens: [result.underlyingAddress, result.id],
            accounts: [],
        });
        this.mapFromSubgraphResponse = (response) => response.tokens.map((x) => ({
            ...x,
            createdAtBlockNumber: Number(x.createdAtBlockNumber),
            createdAtTimestamp: Number(x.createdAtTimestamp),
        }));
        this.requestDocument = TokensDocument;
    }
}
